#include <iostream>
#include <c++/4.8.3/cstring>

using namespace std;


char input[] =
        "\n"
        "\n"
        "\n"
        "\n"
        "\n";

char pad[5][5] = {{NULL,NULL,'1',NULL,NULL},
                  {NULL, '2','3','4' ,NULL},
                  { '5', '6','7','8' ,'9' },
                  {NULL, 'A','B','C' ,NULL},
                  {NULL,NULL,'D',NULL,NULL}};


int x = 2;
int y = 0;

int main()
{
std::string result = "";
     for (int i = 0; i < strlen(input); i++){
            if (input[i] == '\n'){
                result += pad[x][y];
            }
            switch (input[i]){
                case 'L':
                    if (!((y-1 < 0)||(pad[x][y-1] == NULL))) y--;
                    break;
                case 'R':
                    if (!((y+1 < 0)||(pad[x][y+1] == NULL))) y++;
                    break;
                case 'U':
                    if (!((x-1 < 0)||(pad[x-1][y] == NULL))) x--;
                    break;
                case 'D':
                    if (!((x+1 < 0)||(pad[x+1][y] == NULL))) x++;
                    break;
            }
     }
    cout << result << endl;
    return 0;
}

